import React from 'react';
import { Menu, Icon, Search } from 'antd';

const AppTopbar = () => {
    return(
        <div>
          <Menu mode="horizontal">
            <Menu.Item key="mail">
                <Icon type="mail" />
                Navigation One
            </Menu.Item>
            <Search
                placeholder="input search text"
                enterButton="Search"
                size="large"
                onSearch={value => console.log(value)}
            /> 
          </Menu>  
        </div>
    );
};

export default AppTopbar;
